export declare const hdl = "// This file is part of www.nand2tetris.org\n// and the book \"The Elements of Computing Systems\"\n// by Nisan and Schocken, MIT Press.\n// File name: projects/2/Inc16.hdl\n/**\n * 16-bit incrementer:\n * out = in + 1\n */\nCHIP Inc16 {\n    IN in[16];\n    OUT out[16];\n\n    PARTS:\n    //// Replace this comment with your code.\n}";
export declare const cmp = "|        in        |       out        |\n| 0000000000000000 | 0000000000000001 |\n| 1111111111111111 | 0000000000000000 |\n| 0000000000000101 | 0000000000000110 |\n| 1111111111111011 | 1111111111111100 |\n";
export declare const tst = "// This file is part of www.nand2tetris.org\n// and the book \"The Elements of Computing Systems\"\n// by Nisan and Schocken, MIT Press.\n// File name: projects/2/Inc16.tst\n\nload Inc16.hdl,\ncompare-to Inc16.cmp,\noutput-list in%B1.16.1 out%B1.16.1;\n\nset in %B0000000000000000,  // in = 0\neval,\noutput;\n\nset in %B1111111111111111,  // in = -1\neval,\noutput;\n\nset in %B0000000000000101,  // in = 5\neval,\noutput;\n\nset in %B1111111111111011,  // in = -5\neval,\noutput;";
